import React, { Component } from 'react'
import SearchExpert from "../DashbordComponents/SearchExpert"
import ProfileExpert from "../DashbordComponents/ProfileExpert"
import Barchart from "../Chart/chart"


export class DashbordExpert extends Component{
    render()
    {
        return(
            <div>
                <SearchExpert/>
                <ProfileExpert />

                    <div className="row">
                        <div className="col-md-6 chart"><Barchart/></div>
                        <div className="col-md-6"></div>

                </div>

            </div>
        )
    }
}

export default DashbordExpert ;
